function x2016_02a ([string]$inp)
{
    [Int]$PosX = 1;
    [Int]$PosY = 1;
    [string]$code = @()

    $numpad = @((1,2,3),(4,5,6),(7,8,9)) 

    foreach($col in $inp -split "\r?\n")
    {
        foreach($elem in $col.ToCharArray())
        {
 
            Switch -Exact ($elem)
            {
                'U' { #Up
                    if($PosY -gt 0) {$PosY--}
                }

                'L' { #Left
                    if($PosX -gt 0) {$PosX--}
                }

                'R' { #Right
                    if($PosX -lt 2) {$PosX++}
                }

                'D' { #Down
                    if($PosY -lt 2) {$PosY++}
                }
            }
        }
        $code += $numpad[$PosY][$PosX]
    }
    echo "code: $code"
}

 


x2016_02a @"





"@
